(399, 3, '2014-02-11 21:31:21', '2014-02-11 21:31:21', '', 'kw schedule now button', '', 'inherit', 'open', 'open', '', 'kw-schedule-now-button', '', '', '2014-02-11 21:31:21', '2014-02-11 21:31:21', '', 0, 'http://www.kwmassage.com/wp-content/uploads/2014/02/kw-schedule-now-button.jpg', 0, 'attachment', 'image/jpeg', 0),
(113, 3, '2014-01-12 20:59:29', '2014-01-12 20:59:29', '<a href=\"http://youtu.be/XSRrvEXZSdk\" target=\"_blank\" rel=\"http://youtu.be/XSRrvEXZSdk\"><img class=\" wp-image-155 alignleft\" alt=\"Jeremy Bissonnette, Registered Massage Therapist\" src=\"http://www.kwmassage.com/wp-content/uploads/2014/01/img_video-300x276.gif\" width=\"240\" height=\"221\" /></a>I graduated with Honours from the <a href=\"http://www.collegeofmassage.com/cambridge/\">Canadian College of Massage and Hydrotherapy </a>in 2005 as a <a href=\"http://www.cmto.com/\">Registered Massage Therapist </a>(RMT). I’ve practiced massage therapy in Kitchener and Waterloo in a variety of locations in including a home practice, the <a href=\"http://www.uoguelph.ca/hpc/\">University of Guelph’s Health and Performance Center, </a>and most recently, in an independently owned chiropractic office. I have also provided chair treatments at the <a href=\"http://www.kitchenermarket.ca/\">Kitchener Market </a>on a monthly basis in the past.\n\nMy massage therapy treatment style has been focused around <a href=\"http://www.kwmassage.com/deleteme/what-is-deep-tissue-massage\">Deep Tissue Therapy </a>with an emphasis on helping clients learn to care for their own bodies. I have practiced yoga for the past 10 years and find my clients respond well to my recommendations around specific yoga asana and stretches to help with the different ailments they need to address. I find my knowledge of anatomy helps create clarity on the yoga mat and I have an interest in sharing this experience.\n<div class=\"shadowbox\">\n<h2>My Personal World</h2>\nMy main focus in life is caring for my 2 daughters, Rowan (7) and Breanne (5). I’m busy getting kids fed, dressed, doing hair, making bread, doing homework and housework, planning a garden, and all the activities associated with being a parent. Being a dad can have its challenges but it is also very rewarding. I feel very lucky to be able to fill this role while my wife works full-time.\n\nIn my spare time, I enjoy <a href=\"http://www.kwmassage.com/rock_climbing/rock-climbing-as-a-life-style\">rock climbing</a>, yoga, reading, camping, and gardening. Prior to becoming a registered massage therapist, I used to work in a <a href=\"http://www.paramountsports.ca/\">bike and snow board shop</a>, so when I can, I love to hit the hills and get back to my original roots.\n\n</div>', 'About Jeremy', '', 'inherit', 'open', 'open', '', '19-autosave-v1', '', '', '2014-01-12 20:59:29', '2014-01-12 20:59:29', '', 19, 'http://www.kwmassage.com/?p=113', 0, 'revision', '', 0),
(385, 3, '2014-01-23 17:16:12', '2014-01-23 17:16:12', 'Your Rhomboids are muscles in between your shoulder blades. They often get sore and stiff from working at a computer with poor posture. If you need to stretch your Rhomboids, be sure to stretch your pectoral muscles as well.\r\n\r\nIf you are getting pain in your upper back, please see your <a href=\"http://www.kwmassage.com/about\">local massage therapist </a>or other healthcare professional.\r\n\r\nBe sure to review to my <a href=\"http://www.kwmassage.com/stretching/general-guidelines-for-stretching\">General Guidelines for stretching </a>before doing any of the stretches I demonstrate and recommend. It’s always a good idea to see a <a href=\"http://www.kwmassage.com/generalmassagetherapy/governance-of-massage-therapy\">health care professional </a>before starting a new exercise program.\r\n\r\n<iframe src=\"//www.youtube.com/embed/W67Z13XT-50?rel=0\" height=\"315\" width=\"560\" allowfullscreen=\"\" frameborder=\"0\"></iframe>', 'How to Stretch Your Rhomboids ', '', 'inherit', 'open', 'open', '', '322-revision-v1', '', '', '2014-01-23 17:16:12', '2014-01-23 17:16:12', '', 322, 'http://www.kwmassage.com/generalmassagetherapy/322-revision-v1', 0, 'revision', '', 0),
(111, 3, '2014-01-10 14:26:03', '2014-01-10 14:26:03', 'Specializing in Deep Tissue Massage and Trigger Point Release Therapy to bring you the relief you need from repetitive strain injuries and postural dysfunctions related to sports, the workplace and family life.\r\n\r\n<span class=\"black\">(519) 745-4112</span><span class=\"black\">jeremy@kwmassage.com</span><span class=\"black\">7 Clarence Place</span><span class=\"black\">Kitchener, On</span>\r\n<div id=\"formbox\">\r\n<h1>Contact Form</h1>\r\n</div>\r\n[contact-form-7 id=\"9\" title=\"Contact form 1\"]', 'Contact Jeremy', '', 'inherit', 'open', 'open', '', '21-revision-v1', '', '', '2014-01-10 14:26:03', '2014-01-10 14:26:03', '', 21, 'http://www.kwmassage.com/?p=111', 0, 'revision', '', 0),
