(381, 3, '2014-01-17 15:33:36', '2014-01-17 15:33:36', 'Massage therapy is a <a href=\"http://www.kwmassage.com/knowledge-centre/facts-about-registered-massage-therapy-in-ontario\">regulated health profession</a>. The <a href=\"http://www.cmto.com/\">College of Massage Therapist of Ontario </a>(CMTO) is the governing board that oversees and regulates <a href=\"http://www.kwmassage.com/\">massage therapists in Ontario</a>. If you have any questions related to the governance of massage therapy in Ontario, <a href=\"http://www.cmto.com/\">http://www.cmto.com/</a> is a great resource.\r\n\r\nThe <a href=\"http://www.rmtao.com/\">Registered Massage Therapists’ Association of Ontario</a>(RMTAO) is the association that supports <a href=\"https://plus.google.com/+Kwmassage\" target=\"_blank\">registered massage therapists</a> in Ontario. They lobby the government on behalf of all massage therapists in Ontario. They are the association that fought to get massage therapy into the Regulated Health Professionals Act (RHPA). Massage therapy being part of the RHPA is what allows you to have <a href=\"http://www.kwmassage.com/generalmassagetherapy/facts-about-registered-massage-therapy-in-ontario\">massage therapy coverage </a>in your extended health benefits plan. The RMTAO did their best to avoid the new <a href=\"http://www.kwmassage.com/generalmassagetherapy/registered-massage-therapy-and-hst\">Harmonized Sales Tax </a>(HST) from affecting the rate of massage therapy in Ontario. The <span style=\"text-decoration: underline;\">RMTAO</span> is a great education resource.\r\n\r\nThe RMTAO also has a sister website <a href=\"http://www.rmtfind.com/\">RMTfind.com</a> that will allow you to search by <a href=\"http://www.kwmassage.com/contact\">location for a massage therapist </a>in your area.', 'Governance of massage therapy ', '', 'inherit', 'open', 'open', '', '251-revision-v1', '', '', '2014-01-17 15:33:36', '2014-01-17 15:33:36', '', 251, 'http://www.kwmassage.com/generalmassagetherapy/251-revision-v1', 0, 'revision', '', 0),
(100, 3, '2014-01-10 13:25:11', '2014-01-10 13:25:11', '<h1>Kitchener Massage Therapy</h1>\r\nSpecializing in Deep Tissue Massage and Trigger Point Release Therapy to bring you the relief you need from repetitive strain injuries and postural dysfunctions related to sports, the workplace and family life.\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong>by Carrie - Technical Writer</strong>\r\nI walked out of my first treatment with Jeremy impressed that he did exactly what I wanted him to do. Deep tissue massage treatment is nothing like a relaxing day at a spa, but it is precisely what I need...</p>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\"></div>\r\nDeep Tissue massage is similar to the most common type of massage, Swedish massage, in that your therapist uses long, smooth and kneading strokes to achieve healing changes in the body. The two forms of massage differ in that Deep Tissue massage aims to affect the deeper structures of the body and have a deeper level of healing. Deep Tissue massage is very effective in treating chronic muscle and connective tissue injuries.', 'Welcome', '', 'inherit', 'open', 'open', '', '75-revision-v1', '', '', '2014-01-10 13:25:11', '2014-01-10 13:25:11', '', 75, 'http://www.kwmassage.com/?p=100', 0, 'revision', '', 0),
(380, 3, '2014-01-17 15:30:29', '2014-01-17 15:30:29', 'You might have noticed that there are over 300 <a href=\"https://plus.google.com/+Kwmassage\" target=\"_blank\">Registered Massage Therapists </a>in the Kitchener- Waterloo area. This is due mainly to the fact that one of the major massage therapy schools, the <a href=\"http://www.collegeofmassage.com/cambridge/\">Canadian College of Massage and Hydrotherapy </a>is located in Kitchener. This high volume of massage therapists means higher competition between massage therapists. It also means higher levels of service for you, the massage therapy client. <a href=\"http://www.kwmassage.com/about\">Your massage therapist </a>needs to be good to stand out and attract clients.\r\n\r\nWith so many registered Massage Therapists in Kitchener-Waterloo, there is no reason you shouldn’t be 100% happy with yours. Don’t be discouraged and don’t feel obligated to rebook or go back if you’re not happy with your new massage therapist. When you are happy, your therapist will appreciate the loyalty.\r\n\r\nThere are many therapists trying to set themselves apart from the others by learning and using new styles of <a href=\"http://www.kwmassage.com/clinic-information\">massage therapy</a>. There are a lot of styles available for a massage therapist to learn, some of these more effective than others. Don’t be surprised to find your new massage therapist practicing a technique you weren’t expecting. This is fine; for every massage therapy client there is a massage therapist and a different style of massage.\r\n\r\nSince there are over 300 massage therapist in Kitchener and Waterloo, <a href=\"http://www.kwmassage.com/contact\">don’t be afraid to try a new one</a>. Do your research, check out massage therapists online, read reviews on <a href=\"http://www.yelp.ca/biz/kitchener-massage-therapy-kitchener\">Yelp</a>, <a href=\"http://www.linkedin.com/profile/edit?trk=hb_tab_pro_top\">LinkedIn</a>, <a href=\"http://www.facebook.com/pages/KWmassage/354131367967709\">FaceBook</a> and <a href=\"http://maps.google.ca/maps/place?rlz=1I7DDCA_en&amp;oe=UTF-8&amp;redir_esc=&amp;um=1&amp;ie=UTF-8&amp;q=kitchener+massage+therapy&amp;fb=1&amp;gl=ca&amp;hq=massage+therapy&amp;hnear=Kitchener,+ON&amp;cid=4280028541904649170&amp;ei=R2DATcqiM4WltwfcjeWxBQ&amp;sa=X&amp;oi=local_result&amp;ct=map-marker-link&amp;resnum=1&amp;ved=0CEAQrwswAA\">Google Places</a>, call around and ask <a href=\"http://www.kwmassage.com/deleteme/what-is-deep-tissue-massage\">what type of massage </a>a potential therapist offers. See if they have experience dealing with what you need help with most. Personality also goes a long way, though I think you will find most massage therapist are easy to get along with.', 'Massage Therapists in Kitchener and Waterloo ', '', 'inherit', 'open', 'open', '', '320-revision-v1', '', '', '2014-01-17 15:30:29', '2014-01-17 15:30:29', '', 320, 'http://www.kwmassage.com/generalmassagetherapy/320-revision-v1', 0, 'revision', '', 0),
