(400, 3, '2014-02-12 16:40:14', '2014-02-12 16:40:14', 'One of the easiest ways for you to make an appointment with me at the clinic is to book one online! All you need to do is enter your name, date of birth and contact information then pick a time and day, in my scheduling service Cliniko. Scheduling an appointment online is fast, efficient, and easy.\r\n<b>Step #1</b>: How long a massage do you want? You can have 30, 60, or 90 minutes of massage treatment time. The table below includes treatment rates. Click the link for the massage you need.\r\n<b>Step #2</b>: Use the calendar to find an open time slot for your massage treatment. When you find an appointment time that works for you, click the link for that appointment.\r\n<b>Step #3</b>: Enter your name, date of birth and contact information and leave me a note about your appointment if you wish.\r\n<b>Step #4</b>: Review the details of your appointment. It’s easy to change the appointment details if needed. You can also send me a message. When you’re ready to book your massage treatment, click <strong>Book Appointment</strong>.\r\n\r\nYou will receive an email confirmation of your appointment. If you don’t – please try rebooking or contact me directly .\r\nIf you do not want to book online, please feel free to call me to book an appointment. Sometimes, if you are lucky, you might be able to get a last-minute appointment , or I may have additional time slots open that the scheduling tool doesn\'t.\r\n<iframe src=\"https://kwmassage.cliniko.com/bookings?embedded=true\" frameborder=\"0\" scrolling=\"auto\" width=\"100%\" height=\"1000\"></iframe>Please Note:\r\n* an appointment is required in advance\r\n* 24 hours’ notice is necessary to cancel an appointment and all missed appointments must be paid for.\r\n* There is no access to debit or credit in the <a title=\"clinic\" href=\"http://www.kwmassage.com/clinic-information/clinic\">clinic</a>, please bring cash or Cheques only.', 'Appointments', '', 'inherit', 'open', 'open', '', '7-revision-v1', '', '', '2014-02-12 16:40:14', '2014-02-12 16:40:14', '', 7, 'http://www.kwmassage.com/generalmassagetherapy/7-revision-v1', 0, 'revision', '', 0),
