(184, 3, '2014-01-12 20:31:35', '2014-01-12 20:31:35', '<a href=\"http://www.kwmassage.com/wp-content/uploads/2014/01/img_video.gif\"><img class=\" wp-image-155 alignleft\" alt=\"Jeremy Bissonnette, Registered Massage Therapist\" src=\"http://www.kwmassage.com/wp-content/uploads/2014/01/img_video-300x276.gif\" width=\"240\" height=\"221\" /></a>I graduated with Honours from the <a href=\"http://www.collegeofmassage.com/cambridge/\">Canadian College of Massage and Hydrotherapy </a>in 2005 as a <a href=\"http://www.cmto.com/\">Registered Massage Therapist </a>(RMT). I’ve practiced massage therapy in Kitchener and Waterloo in a variety of locations in including a home practice, the <a href=\"http://www.uoguelph.ca/hpc/\">University of Guelph’s Health and Performance Center, </a>and most recently, in an independently owned chiropractic office. I have also provided chair treatments at the <a href=\"http://www.kitchenermarket.ca/\">Kitchener Market </a>on a monthly basis in the past.\r\n\r\nMy massage therapy treatment style has been focused around <a href=\"http://www.kwmassage.com/deleteme/what-is-deep-tissue-massage\">Deep Tissue Therapy </a>with an emphasis on helping clients learn to care for their own bodies. I have practiced yoga for the past 10 years and find my clients respond well to my recommendations around specific yoga asana and stretches to help with the different ailments they need to address. I find my knowledge of anatomy helps create clarity on the yoga mat and I have an interest in sharing this experience.\r\n<div class=\"shadowbox\">\r\n\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam nec nisl interdum eros viverra hendrerit in vel arcu. Sed vel felis dignissim mi varius vestibulum in vel ante. Pellentesque convallis, mi eget facilisis iaculis, velit velit mollis mi, non ullamcorper augue est sit amet neque.\r\n<ul class=\"blue\">\r\n	<li>List item 1</li>\r\n	<li>List Item 2</li>\r\n</ul>\r\n<ol class=\"number\">\r\n	<li>List item 