(234, 3, '2014-01-13 16:19:45', '2014-01-13 16:19:45', 'To save time the day of your first massage appointment please print and complete this form.', 'Health History Form', 'Health History Form', 'inherit', 'open', 'open', '', 'health-history', '', '', '2014-01-13 16:19:45', '2014-01-13 16:19:45', '', 0, 'http://www.kwmassage.com/wp-content/uploads/2014/01/Health-History.pdf', 0, 'attachment', 'application/pdf', 0),
