(275, 3, '2014-01-14 20:18:35', '2014-01-14 20:18:35', 'A friend and client, Josh, was in the Kitchener Massage Therapy Clinic and wanted to create a video review for me. Josh has been rock climbing for about 10 years. Rock climbing is really hard on the body so Josh comes for massage therapy to stay healthy.\r\n\r\n<iframe src=\"//www.youtube.com/embed/RC_Ao0gda3k?rel=0\" height=\"315\" width=\"420\" allowfullscreen=\"\" frameborder=\"0\"></iframe>', 'Video Review for Kitchener Massage Therapy ', '', 'publish', 'open', 'open', '', 'video-reveiw-for-kitchener-massage-therapy', '', '', '2014-01-23 17:11:56', '2014-01-23 17:11:56', '', 0, 'http://www.kwmassage.com/?p=275', 0, 'post', '', 0),
