(279, 3, '2014-01-14 20:21:24', '2014-01-14 20:21:24', '<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong>by Carrie - Technical Writer</strong>\r\nI walked out of my first treatment with Jeremy impressed that he did exactly what I wanted him to do. Deep tissue massage treatment is nothing like a relaxing day at a spa, but it is precisely what I need...</p>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n\r\n<b> </b>\r\n\r\n</div>', 'Testimonials', '', 'inherit', 'open', 'open', '', '277-revision-v1', '', '', '2014-01-14 20:21:24', '2014-01-14 20:21:24', '', 277, 'http://www.kwmassage.com/generalmassagetherapy/277-revision-v1', 0, 'revision', '', 0),
(281, 3, '2014-01-14 20:22:55', '2014-01-14 20:22:55', '<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong>by Carrie - Technical Writer</strong>\r\nI walked out of my first treatment with Jeremy impressed that he did exactly what I wanted him to do. Deep tissue massage treatment is nothing like a relaxing day at a spa, but it is precisely what I need to stay active. I return to Jeremy often to remain limber, flexible, and mobile.\r\nA childhood bicycle collision injured my cervical spine. I have bone spurs on two of my neck vertebrae and that injury forever changed the way my spine works. Over the years, my body has learned to adapt by creating knots of painful, rigid tissues in my muscles, tendons, and ligaments. These knots limit my range of motion, reduce circulation, increase inflammation, and cause chronic pain. Years of chronic pain drove me from the things I love: hiking, long walks, swimming, aerobics, and my daily fitness routine. Chronic pain left me feeling defeated.\r\nDiscovering deep tissue massage gives me hope. Jeremy\'s deep tissue massage breaks down my knots to restore normal movement. I won\'t lie - the treatment is painful, but the days and weeks of mobility are worth every minute. With Jeremy\'s deep tissue massage treatments, aftercare suggestions, and stretches, I can enjoy fitness again and I feel empowered because chronic pain doesn\'t run my life anymore. I do.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>', 'Testimonials', '', 'inherit', 'open', 'open', '', '277-revision-v1', '', '', '2014-01-14 20:22:55', '2014-01-14 20:22:55', '', 277, 'http://www.kwmassage.com/generalmassagetherapy/277-revision-v1', 0, 'revision', '', 0),
(282, 3, '2014-01-14 20:24:13', '2014-01-14 20:24:13', '<h1>Kitchener Massage Therapy</h1>\r\nSpecializing in <a href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\">Deep Tissue Massage </a>and<a href=\"http://www.kwmassage.com/generalmassagetherapy/trigger-points-and-trigger-point-therapy\"> Trigger Point Release Therapy </a>to bring you the relief you need from repetitive strain injuries and postural dysfunctions related to sports, the workplace, and family life.\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong>by Carrie - Technical Writer</strong>\r\nI walked out of my first treatment with Jeremy impressed that he did exactly what I wanted him to do. Deep tissue massage treatment is nothing like a relaxing day at a spa, but it is precisely what I need... <a title=\"Testimonials\" href=\"http://www.kwmassage.com/about/testimonials\">Read more</a></p>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n\r\n<b> </b>\r\n\r\n</div>\r\n<h2>What is Deep Tissue Massage?</h2>\r\nDeep Tissue massage is similar to the most common type of massage, Swedish massage, in that your therapist uses long, smooth, and kneading strokes to achieve healing changes in the body. The two forms of massage differ in that <a title=\"Discomfort of deep tissue massage\" href=\"http://www.kwmassage.com/generalmassagetherapy/does-deep-tissue-massage-heart\">Deep Tissue massage aims to affect the deeper structures of the body </a>and have a deeper level of healing. Deep Tissue massage is very effective in treating chronic muscle and connective tissue injuries. <a href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\">Read more...</a><a title=\"What is Deep Tissue Massage?\" href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\">\r\n</a>\r\n<div id=\"formbox\">\r\n<h1>Contact Form</h1>\r\n</div>\r\n[contact-form-7 id=\"9\" title=\"Contact form 1\"]', 'Welcome', '', 'inherit', 'open', 'open', '', '75-revision-v1', '', '', '2014-01-14 20:24:13', '2014-01-14 20:24:13', '', 75, 'http://www.kwmassage.com/generalmassagetherapy/75-revision-v1', 0, 'revision', '', 0),
(430, 3, '2014-05-29 00:01:08', '2014-05-29 00:01:08', '<h1>Kitchener Massage Therapy</h1>\r\nSpecializing in <a href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\">Deep Tissue Massage </a>and<a href=\"http://www.kwmassage.com/generalmassagetherapy/trigger-points-and-trigger-point-therapy\"> Trigger Point Release Therapy </a>to bring you the relief you need from repetitive strain injuries and postural dysfunctions related to sports, the workplace, and family life.\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong>by Carrie - Technical Writer</strong>\r\nI walked out of my first treatment with Jeremy impressed that he did exactly what I wanted him to do. Deep tissue massage treatment is nothing like a relaxing day at a spa, but it is precisely what I need... <a title=\"Testimonials\" href=\"http://www.kwmassage.com/about/testimonials\">Read more</a></p>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n\r\n<b> </b>\r\n\r\n</div>\r\n<h2>What is Deep Tissue Massage?</h2>\r\nDeep Tissue massage is similar to the most common type of massage, Swedish massage, in that your therapist uses long, smooth, and kneading strokes to achieve healing changes in the body. The two forms of massage differ in that <a title=\"Discomfort of deep tissue massage\" href=\"http://www.kwmassage.com/generalmassagetherapy/does-deep-tissue-massage-heart\">Deep Tissue massage aims to affect the deeper structures of the body </a>and have a deeper level of healing. Deep Tissue massage is very effective in treating chronic muscle and connective tissue injuries. <a href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\">Read more...</a><a title=\"What is Deep Tissue Massage?\" href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\">\r\n</a>\r\n<div id=\"formbox\">\r\n<h1>Contact Form</h1>\r\n</div>\r\n', 'Welcome', '', 'inherit', 'open', 'open', '', '75-revision-v1', '', '', '2014-05-29 00:01:08', '2014-05-29 00:01:08', '', 75, 'http://www.kwmassage.com/generalmassagetherapy/75-revision-v1', 0, 'revision', '', 0),
(318, 3, '2014-01-16 15:16:09', '2014-01-16 15:16:09', 'There are two different ways our muscles get the energy they need to perform during exercise: Aerobic and Anaerobic.\r\n\r\nOur Aerobic (cardiovascular) system carries blood to our muscles with the nutrients the muscles need to create energy to climb or do any other activities. Once the Aerobic system becomes congested and can no longer supply what is needed to perform, the Anaerobic system takes over.\r\n\r\nThe Anaerobic system creates energy inside the cells of the muscle in a process called Anaerobic Metabolism.  It takes hours to recover your Aerobic system once your arms get congested (a pumped or burning feeling). Your Anaerobic system can only create energy for a limited amount of time (30sec.-1 min.) after your Aerobic system quits.\r\n\r\nIt is important to train each system independently.\r\n\r\nTo increase your Aerobic endurance, you need to improve your body’s ability to bring fresh blood into a target muscle group (for rock climbers, that would be your forearms) and remove old/used blood. We can do this by increasing the blood pressure in the forearms for an extended period of time (15-20 minutes). This will put pressure on the veins, arteries, and capillaries, forcing them to expand and grow new branches. It’s kind of like upgrading the plumbing system and making it easier for the blood to flow in and out.\r\n\r\nYou need to climb, nearly constantly without stopping, for 15-20 minutes just below your “pumped” threshold (where there is no lactic acid burn). That is, climb 2-4 grades below your maximum ability making sure you feel fatigue when you’re done, but no burning.\r\n\r\nIf you start getting a burning or “pumped” feeling, stop and lower right away, then go to a different route, 1 grade easier, and continue for the rest of the allotted time. The burn means you are producing lactic acid, which means you have moved into Anaerobic Metabolism and are no longer getting the benefits you are looking for. Anaerobic Metabolism creates lactic acid but is also limited when lactic acid is present, which is why the duration of this energy source is so limited.\r\n\r\nTo increase your Anaerobic endurance, you need to increases your muscle tolerance to lactic acid. To do this you need to force your muscles to continue working with lactic acid present.  Bouldering is a great way to train in this way -- short bursts of high intensity climbing with frequent but short rests.\r\n\r\nThe 4×4 is a great routine to train your Anaerobic endurance. Pick 4 bouldering problems, 1-3 grades below your max. Climb each one 4 times in a row with no rest before moving on to the next problem. Do not rest in the middle of doing your 4 repetitions of a problem; do not top out or rest, keep moving.\r\n\r\nBetween each problem, take 30 seconds of rest before moving on to the next set of 4. You will have done 16 problems in a short period of time. When you’re done your 4×4, your forearms should be burning. If not, choose harder problems next time. If you couldn’t finish, choose easier ones next time.\r\n\r\nMake sure you have warmed up your body well before doing a 4×4.\r\nDon’t do a 4×4 before a session of climbing. It’s not a warm up; it will ruin your session.\r\nDo this at the end of a session or do a short session dedicated to just the 4×4.\r\n\r\nLactic acid is toxic to your muscles and long term exposure to lactic acid can be detrimental to muscle development. Don’t do high intensity training where you are exposing your muscles to lactic acid for long periods of time more than once a week; you don’t need it more than that.\r\n\r\nWhen training for climbing, you need to make sure you are getting sufficient rest. Muscle and tendon strength is increased by overloading the muscles and tendons followed by periods of rest and recovery. Overloading without proper rest will cause degeneration and injuries.\r\nDon’t climb every day; 3-4 days a week is more than enough to progress through the grades.', 'Aerobic vs. Anaerobic Training for Rock Climbing ', '', 'publish', 'open', 'open', '', 'aerobic-vs-anaerobic-training-for-rock-climbing', '', '', '2014-01-23 17:14:08', '2014-01-23 17:14:08', '', 0, 'http://www.kwmassage.com/?p=318', 0, 'post', '', 0),
(283, 3, '2014-01-14 20:26:35', '2014-01-14 20:26:35', '<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong>by Carrie - Technical Writer</strong>\r\nI walked out of my first treatment with Jeremy impressed that he did exactly what I wanted him to do. Deep tissue massage treatment is nothing like a relaxing day at a spa, but it is precisely what I need to stay active. I return to Jeremy often to remain limber, flexible, and mobile.\r\nA childhood bicycle collision injured my cervical spine. I have bone spurs on two of my neck vertebrae and that injury forever changed the way my spine works. Over the years, my body has learned to adapt by creating knots of painful, rigid tissues in my muscles, tendons, and ligaments. These knots limit my range of motion, reduce circulation, increase inflammation, and cause chronic pain. Years of chronic pain drove me from the things I love: hiking, long walks, swimming, aerobics, and my daily fitness routine. Chronic pain left me feeling defeated.\r\nDiscovering deep tissue massage gives me hope. Jeremy\'s deep tissue massage breaks down my knots to restore normal movement. I won\'t lie - the treatment is painful, but the days and weeks of mobility are worth every minute. With Jeremy\'s deep tissue massage treatments, aftercare suggestions, and stretches, I can enjoy fitness again and I feel empowered because chronic pain doesn\'t run my life anymore. I do.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\">\r\n<iframe width=\"560\" height=\"315\" src=\"//www.youtube.com/embed/oKya2ymtKYc?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class