\">\r\n<b> </b>\r\n</div>\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong>by Lidia – Small Business Owner</strong>\r\nBefore I came across Jeremy’s name online in my google search…\r\nI was stressed, over worked and literally carrying all that weight on my shoulders.\r\nI had been to massage therapy places before that felt really soothing and calming, but I had real pain that I needed relieved. So I looked into deep tissue therapy and thought I’d give it a try to finally take some of the pain away.\r\nThe first time was PAINFUL!! Like a good pain But I felt great! Jeremy asked me what my troubles were and showed me some stretches I could do at home to help in between sessions.\r\nNot only am I feeling better, but so is my wallet! Compared to other places I have tried, he is fair and reasonable.\r\nJeremy is very easy to work with and I enjoy exchanging stories about family and adventure.\r\nThanks Jeremy!\r\n\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\">\r\n<iframe width=\"425\" height=\"350\" src=\"//www.youtube.com/embed/RC_Ao0gda3k?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n', 'Testimonials', '', 'inherit', 'open', 'open', '', '277-revision-v1', '', '', '2014-01-14 20:52:51', '2014-01-14 20:52:51', '', 277, 'http://www.kwmassage.com/generalmassagetherapy/277-revision-v1', 0, 'revision', '', 0),
