\">\r\n<b> </b>\r\n</div>\r\n\r\nby Lidia – Small Business Owner\r\n\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\">\r\n<iframe width=\"425\" height=\"350\" src=\"//www.youtube.com/embed/RC_Ao0gda3k?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong> by NB (Waterloo) – High Tech Sector</strong>\r\nI work in an office and developed carpel tunnel after sitting at a desk that wasn’t set up correctly. Previously, I had been very active, going to the gym, etc., but with this painful condiiton I had to stop playing volleyball or lifting any weights. Physio and recommended exercises had not been very helpful. After my first visit with Jeremy, the pain immediately started to lessen. His treatments over some time have gotten me to the point where I can lift weights again and do normal tasks. Jeremy is a fantastic massage therapist. He worked wonders for me and I can’t thank him enough!!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong> by K.T. (Kitchener) – Mobile App Developer</strong>\r\nI see Jeremy for deep tissue treatments to help with neck, shoulder, and back pain from sitting at a computer most of the day. He\'s personable and professional, and his massages really help with my neck/shoulder/back pain. I\'d strongly recommend seeing Jeremy if you\'re looking for a deep tissue massage.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong> by SG (Kitchener) </strong>\r\nI only have good things to say about KW Massage. Jeremy is very personable and easy to schedule appointments with. I used to get terrible tension headaches, but monthly appointments with Jeremy have made them all but disappear!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong> by KOB (Kitchener) – Web Development/Home Renovations</strong>\r\nGetting deep tissue massage from Jeremy for the past 6 years has been an absolute life saver. Jeremy has been able to help me relieve many of my ailments and bodily pains. I competed in 2013 Jiu-Jitsu World Championships and Jeremy was one of the cornerstones of my coaching and therapy team. If you\'re looking to have long term results that last, I would highly recommend using Jeremy and KW Massage. He also has a great website for booking appointments, it\'s worth checking it out.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n\r\n\r\n', 'Testimonials', '', 'inherit', 'open', 'open', '', '277-revision-v1', '', '', '2014-01-14 21:02:09', '2014-01-14 21:02:09', '', 277, 'http://www.kwmassage.com/generalmassagetherapy/277-revision-v1', 0, 'revision', '', 0),
(291, 3, '2014-01-14 21:11:02', '2014-01-14 21:11:02', '<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong>by Carrie - Technical Writer</strong>\r\nI walked out of my first treatment with Jeremy impressed that he did exactly what I wanted him to do. Deep tissue massage treatment is nothing like a relaxing day at a spa, but it is precisely what I need to stay active. I return to Jeremy often to remain limber, flexible, and mobile.\r\nA childhood bicycle collision injured my cervical spine. I have bone spurs on two of my neck vertebrae and that injury forever changed the way my spine works. Over the years, my body has learned to adapt by creating knots of painful, rigid tissues in my muscles, tendons, and ligaments. These knots limit my range of motion, reduce circulation, increase inflammation, and cause chronic pain. Years of chronic pain drove me from the things I love: hiking, long walks, swimming, aerobics, and my daily fitness routine. Chronic pain left me feeling defeated.\r\nDiscovering deep tissue massage gives me hope. Jeremy\'s deep tissue massage breaks down my knots to restore normal movement. I won\'t lie - the treatment is painful, but the days and weeks of mobility are worth every minute. With Jeremy\'s deep tissue massage treatments, aftercare suggestions, and stretches, I can enjoy fitness again and I feel empowered because chronic pain doesn\'t run my life anymore. I do.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\">\r\n<iframe width=\"425\" height=\"350\" src=\"//www.youtube.com/embed/oKya2ymtKYc?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear