 left elbow. This was as a result of doing a lot of rock climbing over a short period and it was recommended by friends. Jeremy was professional and being a climber he had what I think is a unique understanding of my injury.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong> by A Google User </strong>\r\nI had been getting headaches for years on and off. After a few treatments they went away. Deep tissue therapy is a little painful but well worth it.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong> by A Google User </strong>\r\nJeremy is the best massage therapist I have been to! I have had pain in my mid-back for many years and he is the only massage therapist who has actually made my back feel better and who has worked to correct the problems with my back. I would highly recommend him to anyone who wants long-lasting results!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong> by A Google User </strong>\r\nI have been going to Kitchener Massage Therapy for over a year and I love it. I began deep tissue massage for a specific problem, now i return every month because it helps maintain and manage some chronic neck, upper back, and headache issues effectively. I found Jeremy to be excellent at targeting areas, but also general work. He has been helpful with adding stretches and exercises that compliment the massages, and has an extensive knowledge \"referral pain\" to help effectively identify problem areas. He takes the time to get to know you and your body to create the most effective plan for recovery. I will be recommending Jeremy to friends in the future.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong> by A Google User </strong>\r\nJeremy is a great massage therapist that I trust and know will help ease muscle and joint pain. I feel very comfortable with him and know that when I come out from my appointments I will feel 100 times better!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong> by A Google User </strong>\r\nI was recommended to Jeremy from a friend of mine because he is great at deep tissue massage. Sitting in an office chair all day I find my back hurts a lot less now. I would definitely recommend Jeremy to others!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n', 'Testimonials', '', 'inherit', 'open', 'open', '', '277-revision-v1', '', '', '2014-01-14 21:09:29', '2014-01-14 21:09:29', '', 277, 'http://www.kwmassage.com/generalmassagetherapy/277-revision-v1', 0, 'revision', '', 0),
(292, 3, '2014-01-14 21:13:20', '2014-01-14 21:13:20', '<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\"><strong>by Carrie - Technical Writer</strong>\r\nI walked out of my first treatment with Jeremy impressed that he did exactly what I wanted him to do. Deep tissue massage treatment is nothing like a relaxing day at a spa, but it is precisely what I need to stay active. I return to Jeremy often to remain limber, flexible, and mobile.\r\nA childhood bicycle collision injured my cervical spine. I have bone spurs on two of my neck vertebrae and that injury forever changed the way my spine works. Over the years, my body has learned to adapt by creating knots of painful, rigid tissues in my muscles, tendons, and ligaments. These knots limit my range of motion, reduce circulation, increase inflammation, and cause chronic pain. Years of chronic pain drove me from the things I love: hiking, long walks, swimming, aerobics, and my daily fitness routine. Chronic pain left me feeling defeated.\r\nDiscovering deep tissue massage gives me hope. Jeremy\'s deep tissue massage breaks down my knots to restore normal movement. I won\'t lie - the treatment is painful, but the days and weeks of mobility are worth every minute. With Jeremy\'s deep tissue massage treatments, aftercare suggestions, and stretches, I can enjoy fitness again and I feel empowered because chronic pain doesn\'t run my life anymore. I do.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">\r\n<b> </b>\r\n</div>\r\n\r\n<div class=\"testimonialbox\">\r\n<div class=\"testimonialinner\">\r\n<div class=\"quotetop\">\r\n<div class=\"quotebottom\">\r\n<p style=\"padding-bottom: 0px;\">\r\n<iframe width=\"425\" height=\"350\" src=\"//www.youtube.com/embed/oKya2ymtKYc?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear