yer is like speaking a different language, and vice versa. I have experience with many different clients with many different injuries related to many different sports and professions but it’s the climbers that I know understand the best.\r\n\r\nClimbing has been part of my life for a long time. It has permeated the rest of my life, family, and work. I might not be the best climber but I have a lot of experience and have a lot of fun with it. I hope to continue growing my climbing experience, and I hope to share my knowledge by helping as many people as I can with their own climbing.\r\n<div></div>', 'Rock Climbing as a Lifestyle', '', 'inherit', 'open', 'open', '', '314-revision-v1', '', '', '2014-01-16 15:07:30', '2014-01-16 15:07:30', '', 314, 'http://www.kwmassage.com/generalmassagetherapy/314-revision-v1', 0, 'revision', '', 0);
