(405, 3, '2014-02-24 21:34:41', '2014-02-24 21:34:41', '<h1>Working Two Saturdays in March</h1>\r\nI don\'t very often work on Saturdays but in March I will be working two. I need to take the Thursday and Friday of March break off and the PD day on March 7th, I have added march 8th and 15th to help make up for the time lost. This may be a good opportunity for you if you have been struggling to find a time to come in and get those winter kinks worked out.\r\n\r\nAppointments can be booked with the <a title=\"Appointments\" href=\"http://www.kwmassage.com/clinic-information\">online scheduler</a>, don\'t hesitate to email or call if you prefer.', 'March Schedule ', '', 'inherit', 'open', 'open', '', '404-revision-v1', '', '', '2014-02-24 21:34:41', '2014-02-24 21:34:41', '', 404, 'http://www.kwmassage.com/generalmassagetherapy/404-revision-v1', 0, 'revision', '', 0),
(330, 3, '2014-01-16 15:53:26', '2014-01-16 15:53:26', 'I have seen a lot of my climbers come back into the<a title=\"Massage Therapy Clinic Contact Info\" href=\"http://www.kwmassage.com/contact\"> clinic </a>recently. After a full summer of hard climbing, I guess the body needs a little help. I have also seen a few new climber clients come out of the <a title=\"kitchener Local Climbing gym\" href=\"http://www.grandriverrocks.com/Pages/Home.aspx\">climbing gym </a>in the past few months, all suffering from tendonitis at the outside of the elbow (known as lateral epicondylitis, tennis elbow, or climber’s elbow for rock climbers).\r\n\r\nI believe this is happening because the grip strength needed for climbing over-develops the muscles on the front side of the forearm while no extra strength is developed on the back side of the forearm. After a few months of regular climbing (once a week or more) a substantial imbalance can develop. With all this extra force pulling the wrist forward all the time the back side has that much more work to do to perform daily tasks such as using a mouse and keyboard, swinging a hammer, or pulling files out of a filing cabinet. If you do any task that uses the back side of the forearm repetitively in your work or studies, and have such a strength imbalance, you are increasing your chances of getting climber’s elbow.\r\n\r\nThe best thing climbers can do is to proactively avoid the imbalance altogether before experiencing pain. It’s not necessary to stop climbing altogether, but to perform regular exercises to strengthen the back side of the forearm before or after every climbing session.\r\n\r\nPosterior wrist curls are a great option. My favorite option to strengthen and rebalance is to wrap a cord or rope around a piece of broom handle or something similar and tie the other end to a weight of some kind. You would then alternate rolling the wrists to rotate to broom handle to raise and lower the wrists.\r\n\r\nIf you are already starting to experience pain at the outside of your elbow or in your forearm, it’s important to seek professional help. A <a title=\"Kitchener Waterloo Massage Therapist\" href=\"http://www.kwmassage.com/about\">massage therapist </a>or physical therapist is your best option. You need more specific guidance regarding exercises as well as some hands-on manual therapy.\r\n\r\nIf you catch it quickly enough, you might be able to stop it from progressing by taking a few weeks off climbing while slowly improving the strength balance in your forearm.\r\n\r\nLeft untreated, climber’s elbow (tennis elbow) can worsen quickly and take you out of climbing for much longer.\r\n<div>\r\n<div>\r\n\r\n&nbsp;\r\n\r\n</div>\r\n</div>', 'Climber’s Elbow', '', 'publish', 'open', 'open', '', 'climbers-elbow-2', '', '\nhttp://www.kwmassage.com/contact', '2014-01-23 17:22:24', '2014-01-23 17:22:24', '', 0, 'http://www.kwmassage.com/?p=330', 0, 'post', '', 0),
