(334, 3, '2014-01-16 15:57:06', '2014-01-16 15:57:06', 'With so many types of massage to provide to clients, why do I choose to provide <a href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\">Deep Tissue Massage</a>? The short answer is because <a href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\" target=\"_self\">Deep Tissue </a>is the style of massage that I get done on myself and it works for me. It is a straight-forward style of massage where you can <a href=\"http://www.kwmassage.com/generalmassagetherapy/does-deep-tissue-massage-heart\">feel the work being done </a>and tell that it will make a difference right away.\r\n\r\nBefore I became a massage therapist, I was a <a href=\"http://www.kwmassage.com/clinic-information\">massage therapy client</a>. Even before I started studying massage at the <a href=\"http://www.collegeofmassage.com/cambridge/\">Canadian College of Massage and Hydrotherapy in Kitchener, </a>I was seeing Kevin Heeney, a Deep Tissue massage therapist in Kitchener. I got great results with the work Kevin did on me. In fact, Kevin is part of the reason that I became a massage therapist and has been a mentor to me ever since (though I don’t think he realizes it). Any time I have injured my back or neck at work, rock climbing, playing with the kids, or working in the backyard, Kevin has been there for me. I can’t see myself wanting to do anything for my clients other than what Kevin does for me.\r\nI am a <a href=\"http://www.kwmassage.com/about\">deep tissue therapist </a>and a deep tissue massage client because it works for me and for my <a href=\"http://www.kwmassage.com/clinic-information\">clients</a>.', 'Why does Jeremy choose to practice Deep Tissue Massage? ', '', 'publish', 'open', 'open', '', 'why-does-jeremy-choose-to-practice-deep-tissue-massage', '', 'http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\nhttp://www.kwmassage.com/generalmassagetherapy/does-deep-tissue-massage-heart\nhttp://www.kwmassage.com/clinic-information', '2014-01-23 17:24:13', '2014-01-23 17:24:13', '', 0, 'http://www.kwmassage.com/?p=334', 0, 'post', '', 0),
