(342, 3, '2014-01-16 16:15:24', '2014-01-16 16:15:24', 'The <a href=\"http://www.kwmassage.com/stretching/stretch-your-upper-trapezius-muscle\">Levator Scapula </a>muscle runs from the top tip of the shoulder blade up to the top four joints of the neck.  The <a href=\"http://www.kwmassage.com/stretching/stretch-your-upper-trapezius-muscle\">Levator Scapula </a>lifts the shoulder blade and helps control side-to-side movement of the head. A <a title=\"Trigger Points and Trigger Point Therapy\" href=\"http://www.kwmassage.com/generalmassagetherapy/trigger-points-and-trigger-point-therapy\">Trigger Point </a><a href=\"http://www.kwmassage.com/wp-content/uploads/2014/01/levator-stretch-pic.jpg\"><img class=\"alignleft size-full wp-image-246\" alt=\"levator stretch pic\" src=\"http://www.kwmassage.com/wp-content/uploads/2014/01/levator-stretch-pic.jpg\" width=\"191\" height=\"120\" /></a>in the Levator Scapula muscle can cause pain behind the head and to the back of the neck\r\n\r\nTo stretch your <a href=\"http://www.kwmassage.com/generalmassagetherapy/tension-headaches-3\">Levator Scapula </a>muscle, begin in a seated position.\r\n\r\nWith your shoulders relaxed and your head in a natural position, carefully tuck your chin towards your right armpit. If more pressure is needed to feel the stretch, you can use your right hand to gently pull from the top of your head toward the right armpit.\r\n\r\nBe sure not to allow your left shoulder to rise, as this will prevent the muscle from lengthening in to a stretched position. Repeat on the other side.\r\n\r\nBe sure to review to my <a href=\"http://www.kwmassage.com/stretching/general-guidelines-for-stretching\">General Guidelines for stretching </a>before doing any of the stretches I demonstrate and recommend. It’s always a good idea to see a <a href=\"http://www.kwmassage.com/generalmassagetherapy/governance-of-massage-therapy\">health care professional </a>before starting a new exercise program.', 'Stretch Your Levator Scapula ', '', 'publish', 'open', 'open', '', 'stretch-your-levator-scapula-2', '', 'http://www.kwmassage.com/generalmassagetherapy/trigger-points-and-trigger-point-therapy\nhttp://www.kwmassage.com/generalmassagetherapy/tension-headaches-3\nhttp://www.kwmassage.com/stretching/general-guidelines-for-stretching', '2014-01-23 17:27:51', '2014-01-23 17:27:51', '', 0, 'http://www.kwmassage.com/?p=342', 0, 'post', '', 0),
