 Music ', '', 'inherit', 'open', 'open', '', '351-revision-v1', '', '', '2014-01-16 17:34:47', '2014-01-16 17:34:47', '', 351, 'http://www.kwmassage.com/generalmassagetherapy/351-revision-v1', 0, 'revision', '', 0),
(355, 3, '2014-01-16 17:44:24', '2014-01-16 17:44:24', 'It’s May 16th and the weather in the Kitchener, Waterloo has been miserable. We had a few weeks of warmish weather but now we are right back to cold and rainy. You might ask why a <a href=\"http://www.kwmassage.com/\">massage therapist </a>would care about the weather. It’s been good for business, that’s why I care. Our muscles get tight and stiff, old pains come back to the surface, and new ones come out. When this happens, we need to see our massage therapist.\r\n\r\nOur body’s main mechanism to create or retain heat is to increase our metabolism (the amount of food energy we burn). Our body does this by contracting our muscles. Notice how your shoulders rise up to your ears when you walk outside on a cold day without your jacket. Your legs, back, neck, shoulders, and all the muscles in your body will do this. This increase in muscle tension will increase stress on your joints, pull your body out of alignment, and create muscle imbalances. With this added stress to your body, many symptoms like<a href=\"http://www.kwmassage.com/stretching/stretch-your-upper-trapezius-muscle\"> neck pain</a>, <a href=\"http://www.kwmassage.com/stretching/low-back-pain\">back pain</a>, <a href=\"http://www.kwmassage.com/generalmassagetherapy/tension-headaches-3\">headaches</a><span style=\"text-decoration: underline;\">,</span> and muscle achiness surface.\r\n\r\nSeeing your massage therapist will help decrease this muscle tension and correct your muscle imbalances.', 'Does the Weather Make our Muscles Stiff? ', '', 'publish', 'open', 'open', '', 'the-weather-does-make-our-muscles-stiff', '', 'http://www.kwmassage.com/stretching/low-back-pain\nhttp://www.kwmassage.com/generalmassagetherapy/tension-headaches-3', '2014-01-23 17:34:15', '2014-01-23 17:34:15', '', 0, 'http://www.kwmassage.com/?p=355', 0, 'post', '', 0),
(356, 3, '2014-01-16 17:44:24', '2014-01-16 17:44:24', 'It’s May 16th and the weather in the Kitchener, Waterloo has been miserable. We had a few weeks of warmish weather but now we are right back to cold and rainy. You might ask why a <a href=\"http://www.kwmassage.com/\">massage therapist </a>would care about the weather. It’s been good for business, that’s why I care. Our muscles get tight and stiff, old pains come back to the surface, and new ones come out. When this happens, we need to see our massage therapist.\r\n\r\nOur body’s main mechanism to create or retain heat is to increase our metabolism (the amount of food energy we burn). Our body does this by contracting our muscles. Notice how your shoulders rise up to your ears when you walk outside on a cold day without your jacket. Your legs, back, neck, shoulders, and all the muscles in your body will do this. This increase in muscle tension will increase stress on your joints, pull your body out of alignment, and create muscle imbalances. With this added stress to your body, many symptoms like<a href=\"http://www.kwmassage.com/stretching/stretch-your-upper-trapezius-muscle\"> neck pain</a>, <a href=\"http://www.kwmassage.com/stretching/low-back-pain\">back pain</a>, <a href=\"http://www.kwmassage.com/generalmassagetherapy/tension-headaches-3\">headaches</a><span style=\"text-decoration: underline;\">,</span> and muscle achiness surface.\r\n\r\nSeeing your massage therapist will help decrease this muscle tension and correct your muscle imbalances.', 'Does the Weather Make our Muscles Stiff? ', '', 'inherit', 'open', 'open', '', '355-revision-v1', '', '', '2014-01-16 17:44:24', '2014-01-16 17:44:24', '', 355, 'http://www.kwmassage.com/generalmassagetherapy/355-revision-v1', 0, 'revision', '', 0),
(357, 3, '2014-01-16 17:47:46', '2014-01-16 17:47:46', 'Because of the high magnesium content, Epsom salts bath can be helpful any time you are suffering from<a href=\"http://www.kwmassage.com/generalmassagetherapy/what-can-deep-tissue-massage-treat\"> muscle achiness or strain</a>. Please set aside 40 minutes and run a full bath, the temperature of the water should be as hot as you can comfortably tolerate (though please do not exceed 40 degrees Celsius). Place the Epsom salt bath crystals into the water and spend at least 20 minutes soaking and relaxing.\r\n\r\nKeeping your neck and shoulder in the water as much as possible will allow the salts to work directly on the problematic muscles. This is also a great time to enjoy a glass of cold water.\r\n\r\nIf you have a diagnosed heart condition or are over the age of 50, please moderate the water temperature and avoid submerging yourself in hot water above the heart. If you have any concerns about whether a hot Epsom salt bath will affect you adversely, please contact your family physician before using an Epsom salts bath.', 'Epsom Salt Bath ', '', 'publish', 'open', 'open', '', 'epsom-salt-bath', '', '', '2014-01-23 17:34:34', '2014-01-23 17:34:34', '', 0, 'http://www.kwmassage.com/?p=357', 0, 'post', '', 0),
(358, 3, '2014-01-16 17:47:46', '2014-01-16 17:47:46', 'Because of the high magnesium content, Epsom salts bath can be helpful any time you are suffering from<a href=\"http://www.kwmassage.com/generalmassagetherapy/what-can-deep-tissue-massage-treat\"> muscle achiness or strain</a>. Please set aside 40 minutes and run a full bath, the temperature of the water should be as hot as you can comfortably tolerate (though please do not exceed 40 degrees Celsius). Place the Epsom salt bath crystals into the water and spend at least 20 minutes soaking and relaxing.\r\n\r\nKeeping your neck and shoulder in the water as much as possible will allow the salts to work directly on the problematic muscles. This is also a great time to enjoy a glass of cold water.\r\n\r\nIf you have a diagnosed heart condition or are over the age of 50, please moderate the water temperature and avoid submerging yourself in hot water above the heart. If you have any concerns about whether a hot Epsom salt bath will affect you adversely, please contact your family physician before using an Epsom salts bath.', 'Epsom Salt Bath ', '', 'inherit', 'open', 'open', '', '357-revision-v1', '', '', '2014-01-16 17:47:46', '2014-01-16 17:47:46', '', 357, 'http://www.kwmassage.com/generalmassagetherapy/357-revision-v1', 0, 'revision', '', 0),
(359, 3, '2014-01-17 03:11:51', '2014-01-17 03:11:51', 'I started rock climbing in 1997 when I was 21 years old. I started <a href=\"http://www.grandriverrocks.com/Pages/Home.aspx\">climbing in the gym </a>before I ventured outside top-roping and sport climbing a year later. Now I’m a dad, a husband, and a <a href=\"http://www.kwmassage.com/\">massage therapist, </a>but I still love to climb and I plan to climb for the rest of my life.\n\nMy step-brother introduced me to gym climbing when I was 21 and I fell in love right away. It was like I had finally found the answer to the meaning of my life. As I started venturing outside top-roping then sport climbing, everything else in my life started to fade away. I slowly phased out my mountain biking and quit karate and ju-jitsu. I brought <a href=\"http://www.kwmassage.com/about\">yoga</a> into my life a few years later, only because a friend and climbing partner suggested that it would help improve my climbing. I have had to take time off from my climbing; moving around, <a href=\"http://www.kwmassage.com/rock_climbing/395\">injuries</a>, <a href=\"http://www.kwmassage.com/generalmassagetherapy/facts-about-registered-massage-therapy-in-ontario\">massage therapy school, </a>and babies have all taken me away from climbing for periods of time, but I have always come back to it.\n\nNow that <a href=\"http://www.kwmassage.com/about\">I’m a family man, </a>my climbing focus has changed. I spend a lot of time teaching my children to climb, and I help and encourage my wife to improve her climbing skills and experience. I take the whole family up multi-pitch trad climbs and we do day trips up to <a href=\"http://www.kwmassage.com/rock_climbing/395\">Rattle Snake Point </a>to top-rope. My youngest daughter was four when we did our first family trip up to <a href=\"http://www.alpineclubofcanada.ca/facility/bon_echo.html\">Bon Echo National park</a>, a 300 foot multi-pitch trad climb craig.\n\nI do get out climbing without my family as well. I <a href=\"http://www.kwmassage.com/rock_climbing/aerobic-vs-anaerobic-training-for-rock-climbing\">train once or twice a week </a>at <a href=\"http://www.grandriverrocks.com/Pages/Home.aspx\">Grand River Rock</a>, and I get out to Mount Nemo a few times a year. I’ve been up to Bon Echo a handful of times. When I’m climbing with my family, I’m patient, encouraging, and methodical. When I’m out with the boys we like to climb hard and push our limits.\n\nMy training as a <a href=\"http://www.kwmassage.com/clinic-information\">massage therapist </a>has been a great help to my climbing. When I injure myself, I know what to do to get myself back climbing as quick as possible. I know right away if I should use heat or ice, when to stretch, or rest, or just push through. It used to take me a week or more to get a solid answer about how to handle an injury, now I start with the right course of treatment right away. Even more importantly, I know what to do to stay healthy and reduce the risk of injuring myself. <a href=\"http://www.kwmassage.com/category/stretching\">Proper stretching</a>, training supporting muscles, better posture, proper rest periods, and hydrotherapy all keep me strong, flexible, and limber to me keep climbing and training hard.\n\nI find that my <a href=\"http://www.kwmassage.com/generalmassagetherapy/note-to-new-massage-therapy-clients\">massage therapy clients </a>who also rock climb gain specific benefits. Not only have I experienced many of the injuries a climber would come in and seek treatment for, but I have also done the research for my own climbing injuries so I’m up to date regarding the latest medical treatment options and techniques.\n\nI also know the lingo. I know what a crimp is, I know what a jug is and I know the dynamics of a layback and roof climbing. Communicating the specifics of an injury is often difficult between a client and their therapist. Trying to describe a climbing injury to a hockey player is like speaking a different language, and vice versa. I have experience with many different clients with many different injuries related to many different sports and professions but it’s the climbers that I know understand the best.\n\nClimbing has been part of my life for a long time. It has permeated the rest of my life, family, and work. I might not be the best climber but I have a good amount of experience and have a lot of fun with it. I hope to continue growing my climbing experience, and I hope to share my knowledge by helping as many people as I can with their own climbing.\n<div></div>', 'Rock Climbing as a Lifestyle ', '', 'inherit', 'open', 'open', '', '316-autosave-v1', '', '', '2014-01-17 03:11:51', '2014-01-17 03:11:51', '', 316, 'http://www.kwmassage.com/generalmassagetherapy/316-autosave-v1', 0, 'revision', '', 0),
