(387, 3, '2014-01-23 17:26:55', '2014-01-23 17:26:55', 'The Psoas muscle is a strong muscle at the front of your hip. It often affects your <a href=\"http://www.kwmassage.com/stretching/general-guidelines-for-stretching\">low back </a><span style=\"text-decoration: underline;\">and </span>can cause pain. If you sit for long periods of time, be sure to <a href=\"http://www.youtube.com/watch?v=JtnQHieEkqQ\">stretch the Psoas muscle </a>often.\n\nBe sure to review to my <a href=\"http://www.kwmassage.com/stretching/general-guidelines-for-stretching\">General Guidelines for stretching </a>before doing any of the stretches I demonstrate and recommend. It’s always a good idea to see a <a href=\"http://www.kwmassage.com/generalmassagetherapy/governance-of-massage-therapy\">health care professional </a>before starting a new exercise program.\n\n&nbsp;\n<iframe src=\"//www.youtube.com/embed/JtnQHieEkqQ?rel=0\" height=\"360\" width=\"480\" allowfullscreen=\"\" frameborder=\"0\"></iframe>', 'How to Stretch Psoas Muscle ', '', 'inherit', 'open', 'open', '', '338-autosave-v1', '', '', '2014-01-23 17:26:55', '2014-01-23 17:26:55', '', 338, 'http://www.kwmassage.com/generalmassagetherapy/338-autosave-v1', 0, 'revision', '', 0),
(388, 3, '2014-01-23 17:27:00', '2014-01-23 17:27:00', 'The Psoas muscle is a strong muscle at the front of your hip. It often affects your <a href=\"http://www.kwmassage.com/stretching/general-guidelines-for-stretching\">low back </a><span style=\"text-decoration: underline;\">and </span>can cause pain. If you sit for long periods of time, be sure to <a href=\"http://www.youtube.com/watch?v=JtnQHieEkqQ\">stretch the Psoas muscle </a>often.\r\n\r\nBe sure to review to my <a href=\"http://www.kwmassage.com/stretching/general-guidelines-for-stretching\">General Guidelines for stretching </a>before doing any of the stretches I demonstrate and recommend. It’s always a good idea to see a <a href=\"http://www.kwmassage.com/generalmassagetherapy/governance-of-massage-therapy\">health care professional </a>before starting a new exercise program.\r\n\r\n&nbsp;\r\n<iframe src=\"//www.youtube.com/embed/JtnQHieEkqQ?rel=0\" height=\"360\" width=\"480\" allowfullscreen=\"\" frameborder=\"0\"></iframe>', 'How to Stretch Psoas Muscle ', '', 'inherit', 'open', 'open', '', '338-revision-v1', '', '', '2014-01-23 17:27:00', '2014-01-23 17:27:00', '', 338, 'http://www.kwmassage.com/generalmassagetherapy/338-revision-v1', 0, 'revision', '', 0),
(390, 3, '2014-01-23 17:31:56', '2014-01-23 17:31:56', 'I have been treating <a href=\"http://www.kwmassage.com/stretching/low-back-pain\">back pain</a> successfully since 2005. My first clients came to me because of back pain. Over the years, I have found that the overall outcome of <a href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\">massage therapy treatments </a>for back pain has as much to do with the client as it does the <a href=\"http://www.kwmassage.com/about\">massage therapist</a>. The more a client is willing to do on their own, the better their recovery will be. If a client is willing to do the <a href=\"http://www.kwmassage.com/stretching/general-guidelines-for-stretching\">stretches</a>, exercises, and other home care recommended by their massage therapist, they get better sooner.\r\n\r\nI often recommend stretching and strengthening exercises to enhance my massage therapy treatments. I also recommend <a href=\"http://www.kwmassage.com/generalmassagetherapy/epsom-salt-bath\">hot and/or cold applications </a>a lot, depending on the injury.\r\n\r\nOne thing I don’t talk much about in my <a title=\"clinic\" href=\"http://www.kwmassage.com/clinic-information/clinic\">clinic</a> is how to massage at home. I assume that a client will come into see me as often as necessary until they have recovered, so it isn’t beneficial to take the time to teach them how to massage at home. However, sometimes a client can’t see me as often as they would like. Under these situations, it can be very helpful to learn the basics of how to massage yourself, or someone else, at home. You can apply this information to any part of the body. Today, I’m going to focus on back pain.\r\n\r\nThe trick to a successful massage consists of 3 basic principles:\r\n\r\n1) general – specific – general\r\n\r\n2) superficial – deep – superficial\r\n\r\n3) slowly warm and soften the tissue you want to work on.\r\n\r\nAlways follow these 3 principles when doing massage on yourself or anyone else.\r\n\r\nWhen massaging, never dive right in and start treating the injured tissue directly right away. It’s important to always start broadly (general) and lightly (superficial). Gently work the muscles and tissues around the injury first. Once the general area is starting to soften and warm up, you can SLOWLY work your way in towards the muscles you are trying to affect. Once you are working directly on an injured muscle, it’s important that you use slow, firm pressure along the length of the muscle. After about 2 minutes of direct work, or until you feel the muscle start to soften, it’s time to slowly start working your way back out to the superficial and general areas around the injury.\r\n\r\nAlways start and end a massage treatment with gentle pressure. Never try to achieve the same pressure that a <a href=\"http://www.kwmassage.com/generalmassagetherapy/governance-of-massage-therapy\">trained massage therapist </a>uses, you are likely to hurt the person you are working on as well as yourself. It takes a lot of time to develop the strength and control to do <a title=\"What is Deep Tissue Massage?\" href=\"http://www.kwmassage.com/generalmassagetherapy/what-is-deep-tissue-massage\">deep tissue therapy</a> .\r\n\r\nIt can be helpful to talk to your massage therapist about the injury you want to treat at home. Often the <a title=\"Trigger Points and Trigger Point Therapy\" href=\"http://www.kwmassage.com/generalmassagetherapy/trigger-points-and-trigger-point-therapy\">pain is coming from a different part of the body than you might think</a>, and having a professional massage therapist help you locate the right area to work on can be helpful. He/she can also guide you with technique, anatomy, and help you confirm that there aren’t any contraindications for the style of massage you want to do.\r\n\r\nWhen working on yourself, it can be hard to reach your back. Start with a hot pack to soften and relax the muscles. Then, there are a number of ways to reach those sore and hard-to-reach areas:\r\n<ul>\r\n	<li>lean into the corner of a wall using the edge on the muscle on either side of the spine</li>\r\n	<li>lie on a rolled towel and move around until you reach the right area</li>\r\n	<li>lie on a tennis ball on the floor to massage your own back</li>\r\n</ul>\r\nMassaging yourself, a friend, or a loved one can be a great way to help relieve back pain. Always make sure you have a clear idea of what you want to achieve and if you’re not sure, consult with a professional.\r\n<div></div>', 'Back Pain and How to Massage at Home ', '', 'inherit', 'open', 'open', '', '347-revision-v1', '', '', '2014-01-23 17:31:56', '2014-01-23 17:31:56', '', 347, 'http://www.kwmassage.com/generalmassagetherapy/347-revision-v1', 0, 'revision', '', 0),
(391, 3, '2014-01-23 17:32:55', '2014-01-23 17:32:55', 'No, I do not charge an initial consultation fee for <a href=\"http://www.kwmassage.com/clinic-information\">massage therapy treatments</a>.\r\n\r\nI have a simple one page <a href=\"http://www.kwmassage.com/wp-content/uploads/2011/06/Health-History.pdf\" target=\"_blank\">Health History</a> form for you to fill out, and I take 5 minutes or so to go over this form and get a general idea of what I’m treating before we begin. After reviewing your needs, we can get started right away, and any other information I can ask <a href=\"http://www.kwmassage.com/clinic-information\" target=\"_blank\">while I’m treating you</a>.\r\n\r\n&nbsp;\r\n<iframe src=\"//www.youtube.com/embed/br953TUGKxs?rel=0\" height=\"315\" width=\"560\" allowfullscreen=\"\" frameborder=\"0\"></iframe>', 'Do You Charge An Initial Consultation Fee For Massage Therapy Appointments?', '', 'inherit', 'open', 'open', '', '349-revision-v1', '', '', '2014-01-23 17:32:55', '2014-01-23 17:32:55', '', 349, 'http://www.kwmassage.com/generalmassagetherapy/349-revision-v1', 0, 'revision', '', 0),
(404, 3, '2014-02-24 21:34:41', '2014-02-24 21:34:41', '<h1>Working Two Saturdays in March</h1>\r\nI don\'t very often work on Saturdays but in March I will be working two. I need to take the Thursday and Friday of March break off and the PD day on March 7th, I have added march 8th and 15th to help make up for the time lost. This may be a good opportunity for you if you have been struggling to find a time to come in and get those winter kinks worked out.\r\n\r\nAppointments can be booked with the <a title=\"Appointments\" href=\"http://www.kwmassage.com/clinic-information\">online scheduler</a>, don\'t hesitate to email or call if you prefer.', 'March Schedule ', '', 'publish', 'open', 'open', '', 'march-schedule', '', '', '2014-02-24 21:34:41', '2014-02-24 21:34:41', '', 0, 'http://www.kwmassage.com/?p=404', 0, 'post', '', 0),
(440, 3, '2014-06-27 12:01:19', '2014-06-27 12:01:19', 'The quickest way to book an appointment with me is to <a href=\"http://www.kwmassage.com/clinic-information\">book a treatment online</a>.\r\n\r\nTo get in touch with me directly to make a <a title=\"Book Massage Therapy Appointment Online\" href=\"http://www.kwmassage.com/clinic-information\">massage therapy appointment </a>in Kitchener/Waterloo, you can call me, send me an email or text message, or you can <a href=\"http://www.facebook.com/pages/KWmassage/354131367967709\">Facebook</a> me. You can also use the form below to send me a message.\r\n\r\n229 Frederick Street\r\nKitchener, ON\r\n(519) 745-4112\r\n<a href=\"mailto:Jeremy@kwmassage.com\">Jeremy@kwmassage.com</a>\r\n<div></div>\r\n<iframe src=\"https://mapsengine.google.com/map/embed?mid=z1kzsRant038.kwaZ-HV4FUfg\" height=\"400\" width=\"550\"></iframe>\r\n<div id=\"formbox\">\r\n<h1>Contact Form</h1>\r\n[contact-form-7 id=\"431\" title=\"Contact\"]\r\n</div>', 'Contact', '', 'inherit', 'open', 'open', '', '21-revision-v1', '', '', '2014-06-27 12:01:19', '2014-06-27 12:01:19', '', 21, 'http://www.kwmassage.com/generalmassagetherapy/21-revision-v1', 0, 'revision', '', 0);
